text:
LE PRESIDENT DE LA REPUBLIQUE,
VU la Constitution;
VU la loi n°95/18 du 8 août 1995 autorisant le Président de la République à ratifier l'Accord Cadre sur le système de Préférences Commerciales entre les Etats membres de l'Organisation de la Conférence Islamique ;
DECRETE:
Art. 1er —  Est ratifié l'Accord Cadre sur le système de Préférences Commerciales entre les Etats membres de l'Organisation de la Conférence Islamique.
Art. 2 —  Le présent décret sera enregistré, publié suivant la procédure d'urgence, puis inséré au Journal Officiel en français et en anglais. /-
